import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  height: 996px;
  width: 100%;
  padding-top: 168px;
  box-sizing: border-box;
  & > .container {
    text-align: center;
    & > .title {
      font-size: 39px;
      font-weight: bold;
      line-height: 1.31;
      font-family: "cafe24";
      position: relative;
      & > .circle {
        position: absolute;
        top: -12px;
        right: 395px;
        display: grid;
        column-gap: 28px;
        grid-template-columns: repeat(2, 8px);
        & > div {
          width: 8px;
          height: 8px;
          background-color: #007fff;
          border-radius: 8px;
        }
      }
      & > span {
        color: #007fff;
      }
    }
  }
`;

function Section2() {
  return (
    <Wrapper>
      <div className="container">
        <div className="title">
          <div className="circle">
            <div />
            <div />
          </div>
          이젠 한번에
          <span>뭉치</span>
          고 <br /> 깔끔하게 관리하세요!
        </div>
      </div>
    </Wrapper>
  );
}

export default Section2;
